INSERT INTO `questionnaire_page` (`id`, `name`, `group_access`, `show_description`, `label_sv`, `label_en`, `description_sv`, `description_en`) VALUES
(1, 'physical', 1, 0, 'Fysisk kapacitet - tester', 'Physical capacity - tests', 'Din kropp är viktig i ditt liv. Den ska vara tillräckligt stark, smidig och uthållig för att du ska orka arbetet och en rolig fritid.\r\n<br><br>\r\nFölj instruktionen på planscherna noggrant om du vill utvärdera om din träning gör att du blir starkare, får bättre kondition, rörlighet och balans.', 'Your body is important in your life. It should be strong enough, supple and durable for you to cope with schoolwork and have a good leisure time.\r\n<br><br>\r\nFollow the instructions on the posters carefully and you can evaluate if your training will make you stronger, get better fittness, mobility and balance.'),
(2, 'physical_questions', 1, 1, 'Fysisk kapacitet - frågor', 'Physical capacity - questions', 'Ni har nu genomfört de fysiska testerna. Om ni inte har gjort det är det viktigt att ni fyller i IFIS frågorna som kan ersätta testerna.\r\n\r\nFr o m fråga 3 ska ni samtala i grupper omkring varje fråga. Klicka på infoknappen för samtalsfrågorna. Ni ska INTE prata om era egna svar utan mer generellt prata om varje fråga. Det är viktigt att ni respekterar varandra och inte frågar varandra hur man svarat.', NULL),
(3, 'wellbeing', 1, 1, 'Upplevd hälsa', 'Experienced Health', 'Hur mår du i huvud, mage, axlar, nacke och rygg? Känner du dig pigg och utvilad? Tänk tillbaka på den senaste månaden.', '<p>Hur m&aring;r du i huvud, mage, axlar, nacke och rygg? Och k&auml;nner du dig pigg och utvilad? T&auml;nk tillbaka p&aring; den senaste m&aring;naden.</p>'),
(4, 'drugs', 1, 1, 'Beroendeområden', 'Smoking, drugs, alcohol, doping', 'Klicka i det alternativ du tycker passar bäst och tänk dig hur du skulle motivera ditt svar.', 'Young people should feel so secure and have such a good self-image that they do not need alcohol, drugs, or tobacco when interacting with each other.'),
(5, 'energy', 1, 1, 'Mat och energi', 'Food and energy', 'Det är viktigt att ha balans mellan fysisk aktivitet och kost. Du ska förbruka lika mycket energi som du får i dig. Det är också viktigt att ha balans mellan fett, rätt kolhydrater, protein och grönsaker. Hur är det för dig?', 'You should consume as much energy as you get in you. It is also important to have a balance between fat, proper carbohydrates, protein and vegetables. How\'s that for you?'),
(6, 'activities', 1, 1, 'Livet på fritiden', 'Life at leisure', 'En bra fritid ger dig glädje, stimulans och balans i livet.', 'A good leisure time gives you joy, stimulation and balance in life.'),
(7, 'work', 1, 1, 'Livet på arbetet', 'Life at school', 'Jobbet är en viktig del där du tillbringar mycket tid. Frågorna gör förhoppningsvis att du blir ännu mer medveten om hur du mår och fungerar under din arbetsdag och hur du kan påverka den. Håller du balansen mellan fritid och arbete?', 'If you do well in school, you have a better chance of getting good school results. In order for you to feel like going to school every day, you need to feel good both physically, mentally and socially.'),
(8, 'kasam', 1, 1, 'Känsla av sammanhang KASAM', 'SOC', 'KASAM betyder <strong>K</strong>änsla <strong>A</strong>v <strong>SAM</strong>manhang. Detta är när du känner begriplighet, hanterbarhet och meningsfullhet i tillvaron.\r\n<br><br>\r\nHär är några frågor som berör skilda områden i livet. Varje fråga har 7 möjliga svar. Markera den siffra som bäst passar in på ditt svar.\r\n<br>\r\nSiffran 1 eller 7 är svarens yttervärden. Om orden under 1 passar dig, sätt ett kryss i 1:ans ruta, om orden under 7 passar dig sätt då ett kryss i 7:ans ruta.\r\nOm du känner annorlunda, kryssa i den ruta som bäst överensstämmer med din känsla.', 'SOC means <strong>S</strong>ense <strong>O</strong>f <strong>C</strong>oherence. This is when you feel comprehensibility, manageability and meaningfulness.\r\n<br><br>\r\nFollowing are a number of questions concerning different areas of your life. There is a range of answers from 1 to 7. Mark the number that is nearest to how you feel.\r\n<br>\r\n1 and 7 are the most extreme answers. If you agree with the statement at 1, mark box number 1. If you agree with the statement at 7, mark box number 7. If you feel somewhere in between, mark the box that is nearest to how you feel. Please only mark one box for each question.');
