(83, 18, 22, 0, 0, 0, 0, 'activities', 1, 3, '{\"items\":[\"5\",\"4\",\"3\",\"2\",\"1\"],\"labels_sv\":[\"Alltid\",\"N\\u00e4stan Alltid\",\"Oftast\",\"S\\u00e4llan\",\"Aldrig\"],\"labels_en\":[\"Yes, very good\",\"Yes, good\",\"Yes, rather good\",\"No, too demanding\",\"No, too few\"],\"count\":5,\"toggle_value\":\"1\"}', 0, 'Fritidsaktiviteter', 'Leisure intersts', 'Jag har roliga aktiviteter på min fritid (räkna INTE  in speltid och övrig skärmtid).', 'I have leisure interests that give me pleasure, power and recovery.', 'Vad innebär det att ha en bra fritid? Prata om det två och två eller i grupp.', 'By leisure interests is meant all activities that you enjoy, eg books, sports, culture, animals, motors, knitting, coffee, etc.', NULL, NULL, NULL, NULL, NULL),
