(85, 27, 23, 0, 0, 0, 0, 'sitting', 1, 3, '{\"items\":[\"5\",\"4\",\"3\",\"2\",\"1\"],\"labels_sv\":[\"mindre \\u00e4n 6 tim\",\"6-7 tim\",\"8-9 tim\",\"10-11 tim\",\"mer \\u00e4n 11 tim\"],\"labels_en\":[\"Less than 6 hours\",\"6-7 hours\",\"8-9 hours\",\"10-11 hours\",\"More than 11 hours\"],\"count\":5,\"toggle_value\":\"1\"}', 9, 'Stillasittande', 'Sitting Still', 'Dela upp dygnet i tre delar: sömn 8 timmar, arbete 8 timmar och fritid 8 timmar. Du är alltså vaken 16 timmar. Hur många av dessa timmar sitter du stilla. (resor, arbete, hemma mm).', 'Divide the day into three parts: Sleep 8 hours, schoolwork 8 hours and leisure time 8 hours. So you are awake for 16 hours. How many of these hours do you sit still (trips, lessons, at home, etc.)?', 'Hur påverkas man av för mycket stillasittande?\r\nPrata om det två och två eller i grupp.', NULL, NULL, NULL, NULL, NULL, NULL),
(86, 20, 43, 0, 0, 0, 0, 'sleepHour', 1, 3, '{\"items\":[\"5\",\"4\",\"3\",\"2\",\"1\"],\"labels_sv\":[\"7 - 8 timmar\",\"6 timmar\",\"5 timmar\",\"4 timmar\",\"Mindre \\u00e4n 4 eller mer \\u00e4n 9 timmar\"],\"labels_en\":[\"More than 9 hours\",\"9 hours\",\"8 hours\",\"7 hours\",\"Less than 6 hours\"],\"count\":5,\"toggle_value\":\"1\"}', 6, 'Sömn', 'Sleep', 'Jag sover bra.', 'Number of hours of sleep per night', 'Hur påverkas kroppen och hjärnan om man sover för lite? Prata om det två och två eller i grupp.', NULL, NULL, NULL, NULL, NULL, NULL),
